pragma solidity ^0.5.0;

import "./userFactory.sol";

contract UserHelper is UserFactory {

  modifier onlyOwnerOf(uint _id) {
    require(msg.sender == userToOwner[_id]);
    _;
  }

  modifier onlyOwnerOfAddress(address _address) {
    require(msg.sender == _address);
    _;
  }

  /*
    withdraw the money

      function withdraw() external onlyOwner {
        owner.transfer(this.balance);
      }

  */

  /*
    change user's information(userName & phoneNumber)
    userId needed
  */
  function changeUserName(uint _userId, string calldata _userName) external onlyOwnerOf(_userId){
    users[_userId].userName = _userName;
  }

  function changeUserPhoneNumber(uint _userId, string calldata _phoneNumber) external onlyOwnerOf(_userId){
    users[_userId].phoneNumber = _phoneNumber;
  }

  /*
    change houses' information(imageUrl & location & price)
    houseId needed
  */
  function changeHouseImageUrl(uint _houseId, string calldata _imageUrl) external onlyOwnerOfAddress(houseToOwner[_houseId]){
    houses[_houseId].imageUrl = _imageUrl;
  }

  function changeHouseLocation(uint _houseId, string calldata _location) external onlyOwnerOfAddress(houseToOwner[_houseId]){
    houses[_houseId].location = _location;
  }

  function changeHousePrice(uint _houseId, uint32 _price) external onlyOwnerOfAddress(houseToOwner[_houseId]){
    houses[_houseId].price = _price;
  }

  /*
    get user(id) by owner address
  */
  function getUserByOwner(address _owner) external view returns(uint) {
    for (uint i = 0; i < users.length; i++) {
      if (userToOwner[i] == _owner) {
        return i;
      }
    }
  }

  /*
    get houses(id) owner has
    (get houseid array by owner address)
  */
  function getHousesByOwner(address _owner) external view returns(uint[] memory) {
    uint[] memory result = new uint[](ownerHouseCount[_owner]);
    uint counter = 0;
    for (uint i = 0; i < houses.length; i++) {
      if (houseToOwner[i] == _owner && isHouseRented[i] == 0) {
        result[counter] = i;
        counter++;
      }
    }
    return result;
  }

  /*
    get houses(id) renter rents
    (get houseid array by renter address)
  */
  function getHousesByRenter(address _renter) external view returns(uint[] memory) {
    uint[] memory result = new uint[](renterHouseCount[_renter]);
    uint counter = 0;
    for (uint i = 0; i < houses.length; i++) {
      if (houseToRenter[i] == _renter) {
        result[counter] = i;
        counter++;
      }
    }
    return result;
  }

}
